import React from 'react'


const Lemmikud = () => {
    return (
        <div className="container">
            {people && (
                <div className="row">
                    {people.map((person, index) => (
                        <div className="col-md-4" key={index}>
                            <p> phone={person.phone}</p>
                            picture={person.picture}

                        </div>
                    ))}
                </div>
            )}
        </div>
    )
}

export default Lemmikud
